import Container from "react-bootstrap/esm/Container";

function Footer() {
    return (
        <>
            <footer>
                <Container>
                    <p>P.IVA 03453490157, Galleria Vittorio Emanuele II, 75 - 20121 Milano (MI) T. +39 02 8646 4912 | info@ristorantegalleria.it</p>
                    <p>Designed and developed by <a href='https://www.freeattitude.net/' target='_blank' rel="noreferrer">FreeAttitude</a></p>
                </Container>
            </footer>
        </>
    );
}

export default Footer;
